import React from "react";

const Rating = ({ value, text }) => {
  return (
    <div className="rating">
      <i
        className={
          value > 1
            ? "fas fa-star"
            : value == 0.5
            ? "fas fa-star-half-alt"
            : "far fa-star"
        }
      ></i>
      <i class="far fa-star"></i>
      <i class="fas fa-star-half-alt"></i>
    </div>
  );
};

export default Rating;
